import React from 'react';
import './HeroSection.css';

const HeroSection = ({ title, description }) => {
  return (
    <div className="hero-section" data-aos="fade-up">
      <h1>{title}</h1>
      <p>{description}</p>
    </div>
  );
};

export default HeroSection;
